import React from 'react';
import './App.css';
import { BrowserRouter } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <nav>
        <h1>CryptoImage</h1>
        <p>Fun way to encrypt messages to friends!</p>
      </nav>
      <BrowserRouter>
        <Route path='/encode'/>
        <Route path='/decode'/>
      </BrowserRouter>
    </div>
  );
}

export default App;
